import React, { useEffect, useState } from "react";
import { useParams, useNavigate, Link } from "react-router-dom";
import "./VehicleDetail.css"; // Style in separate CSS file

function VehicleDetail() {
  const { id } = useParams();
  const [vehicle, setVehicle] = useState(null);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
      return;
    }
    fetch(`http://localhost:5000/api/vehicles/${id}`, {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => {
        if (!res.ok) throw new Error("Vehicle not found");
        return res.json();
      })
      .then((data) => setVehicle(data))
      .catch((err) => setError(err.message));
  }, [id, navigate]);

  if (error) return <div>{error}</div>;
  if (!vehicle) return <div>Loading...</div>;

  return (
    <div className="vehicle-detail-container">
      <h1 className="title">Vehicle Detail</h1>
      <div className="form-grid">
        <div className="field">
          <label>Name</label>
          <input value={vehicle.name} readOnly />
        </div>
        <div className="field">
          <label>Vehicle Maintenance Due</label>
          <input value={vehicle.maintenance_due} readOnly />
        </div>

        <div className="field">
          <label>
            <i>Current Mileage</i>
          </label>
          <input value={vehicle.current_mileage} readOnly />
        </div>
        <div className="field">
          <label>Brake Service Due</label>
          <input value={vehicle.brake_service_due} readOnly />
        </div>

        <div className="field">
          <label>Oil Change Due</label>
          <input value={vehicle.oil_change_due} readOnly />
        </div>
        <div className="field">
          <label>Tire Rotation Due</label>
          <input value={vehicle.tire_rotation_due} readOnly />
        </div>

        <div className="field">
          <label>Transmission Oil Due</label>
          <input value={vehicle.transmission_oil_due} readOnly />
        </div>
        <div className="field">
          <label>Vehicle Alignment Due</label>
          <input value={vehicle.vehicle_alignment_due} readOnly />
        </div>
        <div className="field">
          <label>Last Service KM</label>
          <input value={vehicle.last_service_km} readOnly />
        </div>
        <div className="field">
          <label>Service Interval KM</label>
          <input value={vehicle.service_interval_km} readOnly />
        </div>
      </div>

      <button className="back-button" onClick={() => navigate(-1)}>
        Back to Dashboard
      </button>
      <Link to={`/vehicle/${vehicle.id}/edit`}>Edit Vehicle</Link>
    </div>
  );
}

export default VehicleDetail;
